import React, { Component } from 'react';
import { Button, Container, Form, FormControl, Nav, Navbar } from 'react-bootstrap';
import logo from './logo.png';
import {BrowserRouter as Router, Routes, Route, Link} from "react-router-dom";
import FilesNav from '../Pages/FilesNav';
import DBNav from '../Pages/DBNav';
import ParsingNav from '../Pages/ParsingNav';

class Header extends Component {
    render() {
        return (
            <>
                <Navbar fixed ="top" collapseOnSelect expand="md" bg ="dark" variant ="dark">
                    <Container>
                        <Navbar.Brand href="/">
                            <img
                                src={logo}
                                height="70"
                                width="70"
                                className="d-inline-flex align-middle"
                                alt="Logo"
                            /> SympChecker
                        </Navbar.Brand>
                        <Navbar.Toggle aria-controls="responsive-navbar-nav"/>
                        <Navbar.Collapse id = "responsive-navbar-nav">
                            <Nav className = "mb-auto">
                                <Nav.Link href="/files">Файлы</Nav.Link>
                                <Nav.Link href="/databases">База данных</Nav.Link>
                                <Nav.Link href="/parsing">Парсинг</Nav.Link>
                            </Nav>
                            
                        </Navbar.Collapse>
                    </Container>
                </Navbar>
                <Router>
                    <Routes>
                        <Route path ="/files" compelementonent ={<FilesNav/>}/>
                        <Route path ="/databases" component ={<DBNav/>}/>
                        <Route path ="/parsing" component ={<ParsingNav/>}/>
                    </Routes>
                </Router>
            </>
        );
    }
}

export default Header;
